LOCK_COIN_STAKING_MAIN:
### ¿Qué es {COIN} Staking?
{COIN} Staking es un producto de staking on-chain de Gate.io, que permite a los usuarios hacer staking de {COIN} y ganar fácilmente recompensas on-chain a través de {Network}.
### Reglas del {COIN} Staking
Si hace staking de {COIN} en un día natural determinado (00:00 - 23:59 UTC), la recompensa del staking se liberará el día D+{IncomeDay}.
Cantidad mínima de staking: {MortgageMin} {COIN}
Límite de staking: {MortgageLimt} 
Cantidad máxima de staking diario: {MortgageMax} 
### Reglas de canje de {COIN}
Como holder de {COIN}, puede canjear sus {COIN} en cualquier momento. El capital y el retorno se abonarán en su cuenta el día D+{RedeemDay} después de que haya enviado una solicitud de canje.
Cantidad mínima de canje: {RedeemMin} {COIN}
Cantidad máxima de canje diario: {RedeemMax}

