{COIN} Staking es un producto de staking on-chain de Gate.io, que permite a los usuarios hacer staking de {COIN} y delegarlo a validadores en {Network} a través de Gate.io. Los usuarios también pueden ganar fácilmente recompensas on-chain.
### Reglas para {COIN} Staking
Si hace staking de {COIN} en un día natural determinado (00:00 - 23:59 UTC), recibirá {REWARD} en una proporción de 1:{ExchangeRate} y ganará recompensas diarias de {REWARD}.
Cantidad mínima de staking :{MortgageMin} {COIN}
Límite de staking: {MortgageLimt} 
Cantidad máxima de staking diaria: {MortgageMax} 
### Reglas de reembolso de {COIN}
Como holder de {REWARD}, puede canjear sus {REWARD} por {COIN} a una relación de {ExchangeRate}:1. El capital y el retorno se abonarán en su cuenta inmediatamente después de presentar una solicitud de canje.
Cantidad mínima de reembolso:{RedeemMin} {COIN}
Cantidad máxima de reembolso diario: {RedeemMax} 
### ¿Qué es {REWARD}?
{REWARD} es un token de staking líquido que genera recompensas y es la representación de su {COIN} en staking en una proporción de 1:{ExchangeRate}.

